import gql from 'graphql-tag'

const SINGLE_ITEM_QUERY = gql`
  query SINGLE_ITEM_QUERY($idL ID!) {
    item(where: { id: $id }) {
      id
      title
    }
  }
`

const Item = props => (
  <div>
    <SingleItem/>
  </div>
)

export default Item
